import React from "react";

import {
  Card,
  WrapperInput,
  SmallLabel,
  Row,
  Input,
  InputCard,
} from "./styles";

function MobileForm() {
  return (
    <>
      <Card />
      <WrapperInput>
        <SmallLabel>número do cartão</SmallLabel>
        <InputCard placeholder="0000 0000 0000 0000" />
      </WrapperInput>
      <Row>
        <WrapperInput>
          <SmallLabel>CVV</SmallLabel>
          <Input placeholder="000" />
        </WrapperInput>
        <WrapperInput>
          <SmallLabel>expiração</SmallLabel>
          <Input placeholder="00/0000" />
        </WrapperInput>
      </Row>
    </>
  );
}

export default MobileForm;
